import React from 'react';
/** 
*@author
*@function Header
**/

const Header = (props) =>{
    return(
        <header className="header">
        <nav>
            <a>Home</a>
            <a>About Us</a>
            <a>Contact Us</a>
        </nav>
            
        </header>
    );
}
export default Header;
